called Rosita Farisi and another man who calls himself &quot;The Doctor&quot;. 
After failing to capture a Cybershade, the two men talk, with the Doctor 
believing the other to be a future regeneration. Unfortunately, the other 
(dubbed &quot;the Next Doctor&quot;) is lacking many memories. Meanwhile, the Cybermen 
are planning an attack with a human ally, Miss Mercy Hartigan. The Doctor 
follows the Next Doctor to a house of a dead man, the Reverend.


